CREATE TABLE `prediction` (
  `predictionId` int(11) NOT NULL,
  `userId` int(11) NOT NULL,
  `gameId` int(11) NOT NULL,
  `teamId1` int(11) NOT NULL,
  `scoreTeam1` int(11) NOT NULL DEFAULT '0',
  `teamId2` int(11) NOT NULL,
  `scoreTeam2` int(11) NOT NULL DEFAULT '0',
  `WinnerId` int(11) DEFAULT NULL,
  `GameDate` datetime NOT NULL,
  `PredictionDate` datetime NOT NULL,
  `Points` int(11) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

--
-- Triggers `prediction`
--
DELIMITER $$
CREATE TRIGGER `trg_chkUpdate` BEFORE UPDATE ON `prediction` FOR EACH ROW begin
declare msg varchar(255);

IF  new.Gamedate<NOW() THEN
		set msg = 'NO PUEDE MODIFICAR PREDICCIONES DE PARTIDOS PASADOS O YA INICIADOS ';
        signal sqlstate '45000' set message_text = msg;
ELSEIF Hour(TIMEDIFF(new.Gamedate,NOW()))=0 and Minute(TIMEDIFF(new.Gamedate,NOW()))<=10 THEN
		set msg = 'Acceso de Modificación Denegado Exedio el Tiempo antes del inicio del partido ';
        signal sqlstate '45000' set message_text = msg;

ELSE
        SET NEW.PredictionDate=NOW();
END IF;

end
$$
DELIMITER ;

